var tipuesearch = {"pages":[{"url":"pages/sobre.html","text":"Why I started this blog My background My family My hobbies","tags":"pages","loc":"pages/sobre.html","title":"Sobre"},{"url":"pages/livro.html","text":"Coming in Fall 2018 Book: Python Programming for Undergraduate Engineers This books is for undergraduate engineers learning programming. It is focused on using Python and programming to solve engineering problems. Chapter List Preface Chapter 1: Orientation Chapter 2: Engineering 101 Chapter 3: Statics Chapter 4: Circuits I Chapter 5: Strengths Chapter 6: Circuits II Chapter 7: Dynamics Chapter 8: Circuits III Chapter 9: Capstone Appendix Pre-order will be available soon","tags":"pages","loc":"pages/livro.html","title":"Livro"},{"url":"primeiro-post.html","text":"O objetivo deste sítio é a divulgação de conceitos e idéias em Física. A responsabilidade pelo conteúdo é exclusiva do Dr. Sócrates de Oliveira Dantas , que atua desde janeiro de 1992 no Departamento de Física (DF), do Instituto de Ciências Exatas (ICE) na Universidade Federal de Juiz de Fora (UFJF). Consequentemente, o DF, o ICE, a UFJF nem mesmo o github possuem qualquer ingerência ou responsabilidade sobre o que aqui está divulgado. Neste sítio você poderá encontrar: conteúdo sobre conceitos importantes de Física; listas de exercícios; áudios sobre os conceitos de Física e resolução de exercícios; alguns códigos em Python e/ou Fortran associados a tópicos interessantes. A ideia é publicar material novo a cada semana.","tags":"Introdução","loc":"primeiro-post.html","title":"Primeiro Post"},{"url":"segundo-post.html","text":"This is the fourth post of a series of posts. It will demonstrate tables. Column Header Column Header Row 1 Data 1 Row 2 Data 2","tags":"Introdução","loc":"segundo-post.html","title":"Segundo Post"}]};